import React from 'react';
import { WeatherProvider } from './components/WeatherContext';
import SearchBar from './components/SearchBar';
import Three from './components/Three';


function App() {
  return (
    <WeatherProvider>
      <div>
        <SearchBar />
        <Three />
      </div>
    </WeatherProvider>
  );
}

export default App;
